Matrix GDproject::pseudo_inv(Matrix J) {

	int n = J.size();
	int m = J[0].size();

	mat Ja = randu<mat>(n,m);
	for (int i = 0; i < n; i++)
		for (int j = 0; j < m; j++)
			Ja(i,j) = J[i][j];

	mat pJa = solve(Ja.t()*Ja,Ja.t());

	Matrix pJ;
	initMatrix(pJ, m, n);
	for (int i = 0; i < m; i++)
		for (int j = 0; j < n; j++)
			pJ[i][j] = pJa(i,j);

	return pJ;
}

State GDproject::get_twist(Matrix Tsb) {
	
	int n = Tsb.size();
	
	mat Tsb_a = MATvector2armadilo(Tsb);
	mat Tsd_a = MATvector2armadilo(Tsd);
	
	// The desired configuration in the body frame
	mat Tbd_a = Tsb_a.i() * Tsd_a;
	
	// "Twist" matrix
	cx_mat Vb_mat_a_cx = logmat(Tbd_a);
	mat Vb_mat_a = real(Vb_mat_a_cx); // Seperate the real matrix from the imaginary
	
	// Convert from matrix to twist
	State Vb = {Vb_mat_a(0,3), Vb_mat_a(1,3), Vb_mat_a(2,3), Vb_mat_a(2,1), Vb_mat_a(0,2), Vb_mat_a(1,0)};
	
	return Vb;
}

