// Misc
void GDproject::initMatrix(Matrix &M, int n, int m) {
	M.resize(n);
	for (int i = 0; i < n; ++i)
		M[i].resize(m);
}

void GDproject::initVector(State &V, int n) {
	V.resize(n);
}

double GDproject::deg2rad(double deg) {
	return deg * PI / 180.0;
}

void GDproject::printMatrix(Matrix M) {
	for (unsigned i = 0; i < M.size(); i++) {
		for (unsigned j = 0; j < M[i].size(); j++)
			cout << M[i][j] << " ";
		cout << endl;
	}
}

void GDproject::printVector(State p) {
	cout << "[";
	for (unsigned i = 0; i < p.size(); i++)
		cout << p[i] << " ";
	cout << "]" << endl;
}

void GDproject::clearMatrix(Matrix &M) {
	for (unsigned i=0; i<M.size(); ++i)
		for (unsigned j=0; j<M[i].size(); ++j)
			M[i][j] = 0;;
}

double GDproject::normVector(State v) {
	double sumv = 0;
	for (int i=0; i<v.size(); ++i)
		sumv += v[i]*v[i];
	return sqrt(sumv);

}

bool GDproject::checkTwistSize(State v, double ep_v, double ep_w) {
	double sumv = 0, sumw = 0;
	for (int i=0; i<v.size()/2; ++i) {
		sumv += v[i]*v[i];
		sumw += v[i+3]*v[i+3];
	}
	return (sumv > ep_v*ep_v || sumw > ep_w*ep_w);
}

State GDproject::VectorSum(State v1, State v2, double alpha) {
	State v(v1.size());
	for (int i=0; i<v.size(); ++i)
		v[i] = v1[i] + alpha*v2[i];
	return v;
}

State GDproject::MATxVEC(Matrix M, State v) {
	State r(M.size());

	for (int i=0; i < M.size(); ++i)
		for (int j=0; j < M[i].size(); ++j)
			r[i] += M[i][j] * v[j];

	return r;
}

Matrix GDproject::MatrixMult(Matrix M1, Matrix M2) {
	// Multiplication of two square nxn matrics
	
	int n = M1.size();

	mat Ma1 = MATvector2armadilo(M1);
	mat Ma2 = MATvector2armadilo(M2);
	
	mat Pa = Ma1 * Ma2;
	
	Matrix P;
	initMatrix(P, n, n);
	for (int i = 0; i < n; i++)
		for (int j = 0; j < n; j++)
			P[i][j] = Pa(i,j);
	
	return P;
}

Matrix GDproject::MatrixInv(Matrix M) {
	// Multiplication of two square nxn matrics
	
	int n = M.size();

	mat Ma = MATvector2armadilo(M);
	
	mat invMa = Ma.i();
	
	Matrix invM;
	initMatrix(invM, n, n);
	for (int i = 0; i < n; i++)
		for (int j = 0; j < n; j++)
			invM[i][j] = invMa(i,j);
	
	return invM;
}

mat GDproject::MATvector2armadilo(Matrix M) {
	
	int n = M.size();
	int m = M[0].size();
	
	mat Ma = randu<mat>(n,m);
	for (int i = 0; i < n; i++)
		for (int j = 0; j < m; j++)
			Ma(i,j) = M[i][j];

	return Ma;
}


void GDproject::log_q(State q) {
	std::ofstream myfile;
	myfile.open("../paths/robot_paths.txt");

	myfile << 1 << endl;

	for (int i = 0; i < q.size(); i++)
		myfile << q[i] << " ";
	myfile << endl;

	myfile.close();
}


